(4, '2792', 'emailMode', 'Cyber Security Program', '<p>Good Evening Sir,</p><p>We have received your enquiry on our cyber security course for the August intake. I have attached our fee structure for the program you have enquired of on the email for you to have a look at.</p><p>Is there any other info I can be able to assist you with?</p><p>Regards,</p><p>Thomas</p>', '', '', '0', '7862541391617291602', '0', NULL, '2021-04-01 03:40:02 PM', '2021-04-01 03:40:02 PM'),
