(6, '2793', 'emailMode', 'Zalego Mobile App Development Program', '<p>Good afternoon Ezra,</p><p>Thank you for your enquiry in our Mobile Application Development course. I am pleased to inform you that we do have an upcoming intake coming in May which you can register for and join the course. I have attached the fee structure in the event you are ready to begin the registration process which can also be done online on our website.</p><p>If you\'ll have any questions or need further clarifications feel free to contact me at 0738408775 and I will gladly assist.</p><p>Happy Easter holidays from us at Zalego Academy.</p>', '', '', '0', '2364951871617364646', '0', NULL, '2021-04-02 11:57:26 AM', '2021-04-02 11:57:26 AM'),
(7, '2794', 'emailMode', 'Zalego Course Enquiry', '<p>Good afternoon Alvin,</p><p>Thank you for your enquiry in our Mobile Application Development and Web design development course. We will have an intake for both courses in May and registration can be done online through our website or by visiting us at the school in Westlands Crossway Road - Devan Plaza 3rd floor. I have attached our fee structure for you to have a look.</p><p>If you\'ll have any questions or need further clarifications feel free to contact me at 0738408775 and I will gladly assist.</p><p>Happy Easter holidays from us at Zalego Academy.</p><p>Regards,</p><p>Thomas.</p>', '', '', '0', '5826741931617364930', '0', NULL, '2021-04-02 12:02:10 PM', '2021-04-02 12:02:10 PM'),
(8, '293', 'emailMode', 'WEB DESIGN AND DEVELOPMENT', '<p>Good morning Priscilla,</p><p>Thank you for your enquiry about the Web design and development program at Zalego. I am pleased to inform you that there is an upcoming May intake for the program and registration is already ongoing. You can do the registration online through our website or by visiting our school at Westlands on Crossway road - Devan Plaza - 3rd floor. I have attached the fee structure for you to also have a look at and if you\'ll have any further questions feel free to contact me at 0738408775.</p><p>Regards,</p><p>Thomas</p>', '', '', '0', '3795286411617520934', '0', NULL, '2021-04-04 07:22:14 AM', '2021-04-04 07:22:14 AM'),
